			shellPath = /bin/sh;
			shellScript = "# combine base lexer description and extensions\nLEXER_MODS='cc.lex'\nrm -f lexer.lex\nperl merge-lexer-exts.pl ${LEXER_MODS} > lexer.lex\nchmod a-w lexer.lex\n\n# run flex on the lexer description\nperl ../smbase/run-flex.pl -nobackup -copies -olexer.yy.cc lexer.lex\n\n# generate token lists\nTOK_MODS='cc_tokens.tok'\nTOK_FILES='cc_tokens.h cc_tokens.cc cc_tokens.ids'\nrm -f ${TOK_FILES}\nperl ./make-token-files ${TOK_MODS}\nchmod a-w ${TOK_FILES}\nif [ $? -eq 0 ]; then\necho \"[DONE] Tokens Generated\"\nelse\necho \"[FAIL] Tokens Generation Failed\"\nfi\n\n# run elkhound to generate the parser\nCC_GR_MODS='cc.gr'\n${BUILD_DIR}/Debug/elkhound -v -tr lrtable -o cc.gr.gen ${CC_GR_MODS}\nif [ $? -eq 0 ]; then\necho \"[DONE] Parser Generated\"\nelse\necho \"[FAIL] Parser Generation Failed\"\nfi\n\n# run astgen to generate the AST implementation\n# c++, type checker, pretty printer, control flow graph, elaboration pass\nCC_AST_MODS='cc.ast cc_tcheck.ast cc_print.ast cfg.ast cc_elaborate.ast'\n${BUILD_DIR}/Debug/astgen -occ.ast.gen ${CC_AST_MODS}\nif [ $? -eq 0 ]; then\necho \"[DONE] AST Implementation Generated\"\nelse\necho \"[FAIL] AST Implementation Generation Failed\"\nfi\n";
